The Westfjords have always been a bit of a mystery to me. That lonely section of Iceland that seems to have endless roads & more hot springs than people. I have always dreamt of building a bikepacking route anyone could do in this region because of its perfect balance of beautiful terrain, amazing climbs and epic food & accommodation in between. I Invited over some of my favorite cyclists & photographers to document the experience so other will hopefully come and experience it for themselves.

We just wrapped up day 2 of the 600+ mile route. Ford full coverage check my IG story and @paysonmcelveen ‘s Podcast The Adventure Stache for daily short updates.

Also check out @nicholekbaker @rugilekaladyte @laelwilcox for coverage !

